import React from 'react';
import "./header.css";
import logo from './img/logo.svg';
import mark from './img/nw_selarw.png';
import bag from './img/bag.png'
import lichni from './img/lichni.png'






const Header = () => {
  return (
   <header>
          <a href="vk.com"><img src={logo} alt="logo" className='logo' /></a>
      <ul class="menu-main">         
         <li><a href=''>Каталог <img src={mark} alt="" className='mark' /></a> </li>
         <li><a href="">F.A.Q</a></li>
         <li><a href="">Контакты</a></li>
      </ul>
          <a href='/'><img src="bag" alt="" /></a>
          <a href='/'><img src="lichni" alt="" /></a>

   </header>
  );
}


export default Header
